import { Fragment } from "react";
import Icon from '../../assets/Images/delivery.png';
import styles from './Cart.module.scss';

const Cart = (props) => {
  return (
    <Fragment>
      <div className="cart">
        <img src={Icon} alt="delivery-icon" />
        <span>Cart</span>
        <span>0</span>
      </div>
    </Fragment>
  );
};

export default Cart;
